            <h3>My posts</h3>
            <div>
                <div>
                    <textarea></textarea>
                </div>
                <div>
                    <button>Add post</button>
                </div>
            </div>
            <Post message={'Hi, how are you?'} likesCount={'0'}/>
            <Post message={'It\'s my first post'} likesCount={'34'}/>
        </div>
    );
};

export default MyPosts;
